%Lateral Slip
%Ian STewart
clear
clc
close all
%% Main
RPM = 9000;
FullSim = STICK(RPM); %[t X DX Y DY Theta DTheta Alpha DAlpha Beta DBeta Lambda1 Lambda2 Coulomb1 Lambda3 Lambda4 Coulomb2]
%X Plot  
figure
subplot(2,1,1)
plot(FullSim(1,:),FullSim(2,:))
title('X')
ylabel('Linear Displacement [m]')
subplot(2,1,2)
plot(FullSim(1,:),FullSim(3,:));
title('DX')
xlabel('Time [sec]')
ylabel('Velocity [m/s]')
%Y Plot
figure
subplot(2,1,1)
plot(FullSim(1,:),FullSim(4,:))
title('Y')
ylabel('Linear Displacement [m]')
subplot(2,1,2)
plot(FullSim(1,:),FullSim(5,:));
title('DY')
xlabel('Time [sec]')
ylabel('Velocity [m/s]')
%Theta Plot
figure
subplot(2,1,1)
plot(FullSim(1,:),FullSim(6,:))
title('Theta')
xlabel('Time [sec]')
ylabel('Anglular Displacement [rad]')
subplot(2,1,2)
plot(FullSim(1,:),FullSim(7,:));
title('DTheta')
xlabel('Time [sec]')
ylabel('Anglular Velocity [rad]')
%Alpha Plot
figure
subplot(2,1,1)
plot(FullSim(1,:),FullSim(8,:))
