xlabel('Time [sec]')
ylabel('Anglular Displacement [rad]')
subplot(2,1,2)
plot(FullSim(1,:),FullSim(9,:));
title('DAlpha')
xlabel('Time [sec]')
ylabel('Anglular Velocity [rad]')
%Beta Plot
figure
subplot(2,1,1)
