IC = [0.52666 0];
[a,alpha0,AD,BC,CG,g,I,k,L,M,mp,mu,phi,T,w] = parameters(RPM,IC);

figure
plot(-a*sin(w*FullSim(1,:)+phi),-a*cos(w*FullSim(1,:)+phi))


