%% Parameter Function
function [a,alpha0,AD,BC,CG,g,I,k,L,M,mp,mu,phi,T,w] = parameters(RPM,IC)
    %Measured parameters
    a = 1.85/1000; %Distance to center oentric mass [m]
    alpha0 = pi/6;
    BC = 7.23/1000;
    CG = 10.42/1000;
    g = 9.81; %Gravity [m/s^2]
    k = 2*(0.0246); %Torsional spring const [N/m]
    L = 5.45/1000; %Height of bristle [m]
    AD = 2*L*sin(IC(1))+BC;
    M = 11.218/1000; %Mass of the robot and eccentric mass [kg]
    mp = 0.942/1000; %Mass of the eccentric mass [kg]
    mu = 1; %Static friction coeficient of bristles on ground [-]
    phi = pi;
    Rr = (20.43/2)/1000; %Radius of robot body [m]
    I = 0.5*(M-mp)*Rr^2 + (M-mp)*CG^2;
    %Speed calculation
    Hz = RPM/60; %Speed of motor [cyc/s]
    T = 1;%abs(1/Hz); %Speed of a cycle [s/cyc]
    w = 2*pi*Hz; %Speed of motor [rad/s]
end